def duplicates(arr, n): 

        zeros_count = 0
        res=set()
        for n in arr:
            num = abs(n)
            if arr[num] < 0:
                res.add(num)
            elif num == 0:       # Special handling for zero as we cant negate it
                 zeros_count += 1
            else:
                arr[num] = -arr[num]
        if zeros_count > 1:
             res.add(0)
        if len(res) == 0:
            return [-1]
        print(arr)
        return sorted(list(res))

